import React, { useState } from 'react';
import errorMessages from './error-messages';
import spinner from './spinner.svg';
import { fetchLists } from './services';

const Users = () => {
    const [usersList, setUsersList] = useState({});
    const [error, setError] = useState('');

    fetchLists()
    .then( (usersMessagesList) => {
        setUsersList(usersMessagesList.usersList) ; // inform parent
    })
    .catch( (err) => {
      setError(errorMessages[err.code || 'DEFAULT']);
    });
   
    const temp =  ` <ul className="users">` +
    Object.values(usersList).map( user => `
    <li>
        <div className="user">
            <span className="username">${user.username}</span>
        </div>
    </li>
    `).join('') +
`</ul> `

    return (
        <div>
            ` <ul className="users">` +
                Object.values(usersList).map( user => `
                <li>
                    <div className="user">
                        <span className="username">${user.username}</span>
                    </div>
                </li>
                `).join('') +
            `</ul> `
        </div>
    )
}
export default Users;
